const ip = '192.168.1.23';
const port = '4000';

const Config1 = {
  //  url: `https://agtekdac.herokuapp.com`
  url: `http://${ip}:${port}`
};

// eslint-disable-next-line import/prefer-default-export
export const Config = Config1;
